import React, { Component } from "react";

export class CreateBoard extends Component {
	CreateNewBoard = () => {
		console.log("new board create");
	};
	render() {
		return (
			<>
				<div  onclassName=" bg-gray-300 h-20 w-1/5 inline-block cursor-pointer p-3  m-1 flex items-center justify-center text-gray-400">
					create new board
				</div>
			</>
		);
	}
}

export default CreateBoard;
